    public static String getRandomStr(String var){
        int maxLength = getRandomInt(var.length());
        String str = change(var,maxLength);
        return str;
    }

    /**
     * 获取<参数值得随机数（>=0  and  < max）
     *
     * @param max
     * @return
     */
    public static int getRandomInt(int max){

        SecureRandom secureRandom = new SecureRandom();
        int randomNumber =  secureRandom.nextInt(max);

        return randomNumber;
    }

    /**
     * 根据传入的字符串生成maxLength的随机字符串
     *
     * @param base
     * @param maxLength
     * @return
     */
    public static String change(String base,Integer maxLength){
        if (base == null || base.length() == 0) {
            throw new IllegalArgumentException();
        }

        int length = base.length();
        if (maxLength == null || maxLength == 0){
            maxLength = length;
        }

        StringBuilder sb = new StringBuilder();
        for (int i = 0; i < maxLength; i++) {
            int index = getRandomInt(length);
            char one = base.charAt(index);
            sb.append(one);
        }

        String str = sb.toString();
        return str;
    }

